import React, { Component } from "react";
import Images from './Images';

class List extends Component {

    render(){
        return(
            <div>
                <Images/>
                OL
                    <li>1</li>
                    <li>2</li>
                    <li>3</li>
                    <li>4</li>
            </div>
        );
    }
}

export default List;
